import {Navigate, Route, Routes} from "react-router-dom"

function ProtectedRoute ({ component: Component, ...props }) {
    return (
		<Routes>
			<Route>
				{() =>
					props.isLogIn ? <Component {...props} /> : <Navigate to="/sign-in"/>
				}
			</Route>
		</Routes>
    )
}
export default ProtectedRoute
